import{_ as a,c as e,o,ah as n}from"./chunks/framework.PvdZnrZd.js";const d=JSON.parse('{"title":"MULTIVENDOR DATABASE BACKUP","description":"MULTIVENDOR DATABASE BACKUP","frontmatter":{"title":"MULTIVENDOR DATABASE BACKUP","description":"MULTIVENDOR DATABASE BACKUP","author":"Chirag Tyagi"},"headers":[],"relativePath":"zenith/featured-app/Marketplace-other-add-ons/multivendor-database-backup.md","filePath":"zenith/featured-app/Marketplace-other-add-ons/multivendor-database-backup.md"}'),s={name:"zenith/featured-app/Marketplace-other-add-ons/multivendor-database-backup.md"};function r(i,t,p,l,c,u){return o(),e("div",null,[...t[0]||(t[0]=[n('<p>In the below-mention user guide, we will show you and guide you on how to install and set up Multi-vendor Database Backup.</p><p>In today&#39;s digital age, data is at the heart of every organization&#39;s operations.</p><p>Whether it&#39;s customer information, financial records, or product inventory, databases store the valuable information that keeps businesses running smoothly.</p><p>However, with the increasing threat of data loss due to hardware failures, software glitches, human errors, or even malicious attacks,</p><p>ensuring the integrity and availability of this data has become paramount.</p><p>We as a webkul introduce a feature app, <strong>Multi-vendor Database Backup</strong>. This feature helps you to get the past data in an app form.</p><p>The cost of this feature is <strong>10$ per month.</strong></p><h2 id="feature-multi-vendor-database-backup" tabindex="-1">Feature: <strong>Multi-vendor Database Backup</strong> <a class="header-anchor" href="#feature-multi-vendor-database-backup" aria-label="Permalink to &quot;Feature: **Multi-vendor Database Backup**&quot;">​</a></h2><ul><li>As an admin, you can create a backup of duration from the multivendor marketplace app date to the selected date.</li><li>You can select any date from the last 6 days to restore/to get the backup of the app.</li><li>After creating a successful backup you will get a Multivendor app exactly the same as chosen. date by the admin/user.</li><li>Admin can compare the data from the past to the present</li><li>The admin can get the backup data without any hassle.</li></ul><p><strong>Note:</strong></p><p>In the backup instance of the app, you can not perform any action just like ADD, EDIT, and DELETE.</p><p>If you are on a partner store/development store/ not under the</p><p>shopify paid plan then you can not use the Multi-vendor Database Backup feature app.</p><h2 id="installation" tabindex="-1">Installation <a class="header-anchor" href="#installation" aria-label="Permalink to &quot;Installation&quot;">​</a></h2><p>To install the <strong>Multi-vendor Database Backup</strong>, you need to go to admin panel &gt;&gt; 3dots &gt;&gt; feature app.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2023/09/21-1-1200x456.png" alt="21-1"></p><p>Now, search for it and click on the enable button to install the feature app.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2023/09/screenshot_1694682819177-1200x435.png" alt="screenshot_1694682819177"></p><h2 id="configuration-multivendor-database-backup" tabindex="-1">Configuration: <strong>Multivendor Database Backup</strong> <a class="header-anchor" href="#configuration-multivendor-database-backup" aria-label="Permalink to &quot;Configuration: **Multivendor Database Backup**&quot;">​</a></h2><hr><p><strong>How to Access Multi-vendor Database Backup</strong></p><p>Once the <strong>Multi-vendor Database Backup</strong> feature app is successfully installed, follow these steps to access and configure it:</p><ol><li>Go to your <strong>Multivendor Admin Panel</strong>.</li><li>Click on the <strong>three dots (⋮)</strong> located at the top-right corner of the dashboard.</li><li>From the dropdown menu, select <strong>Multi-vendor Database Backup</strong>.</li><li>Then click on <strong>Multi-vendor Backup Configuration</strong> to begin the setup.</li></ol><p>This section allows you to manage your backup settings and view available backup data.<strong>.</strong></p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2023/09/11-2-1200x507.png" alt="11-2"></p><p>The process of creating the data backup here is known as the creation of instance.</p><p>From this page you can create instance for the backup.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2023/09/321-1200x514.png" alt="321"></p><h2 id="creating-a-backup-instance" tabindex="-1"><strong>Creating a Backup Instance</strong> <a class="header-anchor" href="#creating-a-backup-instance" aria-label="Permalink to &quot;**Creating a Backup Instance**&quot;">​</a></h2><p>Once you&#39;re on the <strong>Multi-vendor Backup Configuration</strong> page, you’ll find the option to <strong>create a new backup instance</strong>.</p><p>Please note:</p><blockquote><p><strong>Each backup instance is chargeable. The cost for one instance is $25.</strong></p></blockquote><p>To create a backup, follow these steps:</p><p><strong>Launch Description</strong>:<br> You can add a short <strong>description</strong> of the backup, explaining what data or event the backup covers.</p><p><strong>Launch Backup Day</strong>:<br> Select a backup date from the <strong>last 6 days</strong>.<br> The system will create a backup from the date you installed the Multivendor app <strong>up to the selected Launch Backup Day</strong>.</p><p><strong>Launch Title</strong>:<br> Provide a relevant <strong>title</strong> for the backup instance. This will help you easily identify it later.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2023/09/567-1200x547.png" alt="567"></p><p>After creating an instance or the backup you will land on the <strong>Multivendir Backup Instance</strong> <strong>page</strong></p><p>Here you will get a list of instances with <strong>ID, LAUNCH TITLE, LAUNCH BACKUP DATE, LAUNCH DATE, LAUNCH TERMINATION DATE, CHARGES, STATUS,</strong> and <strong>ACTION</strong>.</p><p>On this page, you will get 3 statuses of the instances as mentioned below.</p><ul><li><strong>Processing:</strong> It means data is in process in the background.</li><li><strong>Active:</strong> It means the Backup has been successful.</li><li><strong>Terminated:</strong> It means the backup process is stopped.</li></ul><p><strong>NOTE:</strong></p><p>We do not charge for the first 2 hours of active instance but after the 2 hours, you will be charged <strong>5$/ hour.</strong></p><p><strong>For example:</strong></p><p>The admin created an instance and instance is in active status for 2 hours then the admin will not be charged for it.</p><p>But in case the instance is in active state for more than 2 hours then you will be charged 5$ per hour.</p>',46)])])}const g=a(s,[["render",r]]);export{d as __pageData,g as default};
